import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home'
import { BrowserRouter as Router, Link, Route}
from "react-router-dom";

function App() {
  return (
    <Router>
      <div clasName="app">
      <Link>
        <Route path="/">
          <Header />
          <Home />
        </Route>
      </Link>
      </div>
    </Router>
  );
}

export default App;
